import React from "react";
import "./NavBar.css";
function NavBar() {
  return (
    <div className="navbar-container">
      <h2>Grove Burner</h2>
      <ul>
        <li>Home</li>
        <li>Start a Grovelist</li>
      </ul>
    </div>
  );
}

export default NavBar;
